import { Modal, ModalBody, ModalFooter, ModalHeader } from 'reactstrap';
import { Component } from 'react';

const url="https://61736fee110a74001722302b.mockapi.io/Usuarios";

class App extends Component() {
  render(){
    return (
      <div className="App">
       <br/>
       <button className="btn btn-success">Agregar Usuario</button>
       <br/><br/>
        <table className="table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Email</th>
              <th>Telefono</th>
              <th>Ciudad</th>
              <th>Pais</th>
            </tr>
          </thead>
          <tbody>


          </tbody>

        </table>
      </div>
    );
  }
}

export default App;
